/*HOW TO PLAY: Press a key/pushbutton to choose a template. Try to copy the image on the left side.
 *When you think your drawing matches the example template, press ENTER to see if you've won or lost
 *After you press ENTER, press any key/pushbutton to replay the game with a different
 *template. 
 *KEY0 is a freeplay/sandbox mode. You can quit by pressing ENTER
 *and then pressing another key/pushbutton to play again.
*/
int main(void)
{
    //I/O device variables
    volatile int* key_data_reg = (int*)0xFF200050;
    volatile int* switch_data_reg = (int*)0xFF200040;
    volatile int* priv_timer_val = priv_timer_ld + 1;
    volatile int* priv_timer_ctrl = priv_timer_ld + 2;

    int key_data;
    int keyboard_data;
    int SW0 = 0, SW1 = 0, SW2 = 0, SW3 = 0, SW4 = 0, SW5 = 0, SW6 = 0, SW7 = 0, SW8 = 0, SW9 = 0;

    //drawing variables
    int pixel_inc = 1;
    int px_size = 2;
    int x_min = 160;
    int x_max = 319;
    int y_min = 0;
    int y_max = 239;
    int x_pos = 230, y_pos = 90;

    //timer and blinking cursor variables
    int ld_val = 250000000;
    short int colour = 0xFFFF;
    short int save_colour = 0xFFFF;
    short int blink_colour = 0xFFFF;
    bool idle = false, wonGame = true, endGame = false, freePlay = false;

    /* using single buffering. cursor_delay is already > 1/60th of a sec */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; 
    wait_for_vsync(&keyboard_data);
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);
    clear_screen();

    //Save copies of left side and right side of screen. use to check if both sides match
    short int trace[HEIGHT][WIDTH];
    short int example[HEIGHT][WIDTH];



    //TO DO: draw title screen



    //wait for user to press key to start game
    key_data = wait_to_start_game(key_data_reg);

    while(true) { //each iteration of this while loop will play one game
        //set up new game
        switch (key_data) {
        case 0: {
            freePlay = true;
            x_pos = 160;
            y_pos = 120;
            x_min = 0;
            clear_screen();
            for (int r = 0; r < HEIGHT; r++) {
                for (int c = 0; c < WIDTH; c++) {
                    example[r][c] = 0;
                    trace[r][c] = 0;
                }
            }
            break;
        }
        case 1: {
            freePlay = false;
            draw_dino(example, trace);
            x_pos = 230;
            y_pos = 90;
            x_min = 160;
            break;
        }
        case 2:
        {
            freePlay = false;
            draw_template2(example, trace); //UNFINISHED
            //TO DO : update xPos, yPos to start on the picture
            x_min = 160;
            break;
        }
        case 3:
        {
            freePlay = false;
            draw_template3(example, trace); //UNFINISHED
            //TO DO: update xPos, yPos to start on the picture
            x_min = 160;
            break;
        }
        default: { //will probably never execute this
            freePlay = true;
            clear_screen();
            break;
        }
        }

        //reset variables before starting game
        keyboard_data = 0xF0; //set it to 'break key code' to make pixel blink at start of game
        endGame = false;
        *priv_timer_ld = ld_val;

        while (!endGame)
        {
            //poll switches

            int switch_data = *switch_data_reg;
            SW0 = switch_data & 0b0000000001;
            SW1 = switch_data & 0b0000000010;
            SW2 = switch_data & 0b0000000100;
            SW3 = switch_data & 0b0000001000;
            SW4 = switch_data & 0b0000010000;
            SW5 = switch_data & 0b0000100000;
            SW6 = switch_data & 0b0001000000;
            SW7 = switch_data & 0b0010000000;
            SW8 = switch_data & 0b0100000000;
            SW9 = switch_data & 0b1000000000;

            //sw9 clears screen if you're in freeplay mode
            if (!(SW9 == 0) && freePlay) { //keeps repeating if sw9 is on
                clear_screen();
                continue;
            }

            //change colour based on switches 2-0 
            if (SW0 == 0 && SW1 == 0 && SW2 == 0)//000
                colour = 0xFFFF;//white
            if (SW0 == 1 && SW1 == 2 && SW2 == 4)//111
                colour = 0x0000;//black
            if (SW0 == 0 && SW1 == 0 && SW2 == 4)//100
                colour = 0xF800;//red
            if (SW0 == 1 && SW1 == 0 && SW2 == 4)//101
                colour = 0xF81F;//magenta
            if (SW0 == 0 && SW1 == 2 && SW2 == 0)//010
                colour = 0x07E0;//green
            if (SW0 == 1 && SW1 == 0 && SW2 == 0)//001
                colour = 0x001F;//blue
            if (SW0 == 1 && SW1 == 2 && SW2 == 0)//011
                colour = 0x07FF;//cyan
            if (SW0 == 0 && SW1 == 2 && SW2 == 4)//110
                colour = 0xFFE0;//yellow
            //colour = pixel_color(SW0, SW1, SW2);
            save_colour = colour; //save colour in case we're blinking the pixel

            //if keys aren't being pressed, measure inactive time with private timer
            //If user idle, change pixel
            //colour every time the timer reaches zero to make it 'blink'
            if ((keyboard_data == 0xF0) && (!idle)) {
                idle = true;
                *priv_timer_ctrl = 3; //start timer with auto reload
            }
            else if (keyboard_data != 0xF0) {
                idle = false;
                *priv_timer_ctrl = 0; //stop timer
                plot_bigger_pixel(x_pos, y_pos, save_colour, px_size); //overwrite 'blinked' colour before continuing
            }

            //increment position
            switch (keyboard_data) {
            case 0x75:
                //(template[x_pos][y_pos - 1] == boundary || y_pos == 0) ?
                y_pos -= (y_pos <= y_min) ? 0 : pixel_inc; //go up. stop at top of screen.
                break;
            case 0x72: //down
                y_pos += (y_pos + px_size >= y_max) ? 0 : pixel_inc; //go down. stop at bottom of screen.
                break;
            case 0x6B: //left
                x_pos -= (x_pos <= x_min) ? 0 : pixel_inc; //go left. stop at edge of screen
                break;
            case 0x74: //right
                x_pos += (x_pos + px_size >= x_max) ? 0 : pixel_inc; //go right. stop at edge of screen
                break;
            default:; //do nothing
            }

            //change colour of blinking pixel 
            if (idle) {
                if ((*priv_timer_val) < (ld_val / 2)) {
                    colour = (colour == blink_colour) ? 0 : blink_colour; //use black if colour is same as blink_colour
                }
                else {
                    colour = save_colour;
                }
            }

            plot_bigger_pixel(x_pos, y_pos, colour, px_size);

            //update user's trace
            for (int x = x_pos; x < x_pos + px_size; x++)
                for (int y = y_pos; y < y_pos + px_size; y++)
                    trace[x][y] = save_colour;

            //if user pressed enter, check if the drawings match. end the game.
            wonGame = true;
            if (keyboard_data == 0x5A) {
                for (int row = 0; row < 240; row++) {
                    for (int col = 0; col < 160; col++) {
                        if (example[row][col] != trace[row][col]) {
                            wonGame = false;
                        }
                    }
                }
                endGame = true;
            }

            wait_for_vsync(&keyboard_data);
        }

        //print game-over / win depending on wonGame
        if (!freePlay)
            disp_hex_msg(wonGame, key_data_reg, &key_data);
        else {
            key_data = wait_to_start_game(key_data_reg);
        }
    } //while true
}

short int pixel_color (int r, int g, int b) { 
    return ((r<<10) + (g<<4) + b);
}

void plot_pixel(int x, int y, short int line_color)
{
    *(short int*)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void plot_bigger_pixel(int x, int y, int colour, int px_size) {
    for (int x_pos = x; x_pos < x + px_size; x_pos++)
        for (int y_pos = y; y_pos < y + px_size; y_pos++)
            plot_pixel(x_pos, y_pos, colour);
    
}

//draw black pixels to clear the entire screen
void clear_screen() {
    for (int x = 0; x <= 319; x++)
        for (int y = 0; y <= 239; y++)
            plot_pixel(x, y, 0x0000);
}

//while waiting for video out to finish drawing to VGA,
//keep reading keyboard data to prevent the ps2 read buffer from overflowing
void wait_for_vsync(int* keyboard_data_ptr) {
    char byte1 = 0, byte2 = 0, byte3 = 0;
    int break_key = 0xF0;
    int PS2_data;
    int RVALID;
    /*
    *(pixel_ctrl_ptr) = 1; //write 1 to reset status flag

    int status = *(pixel_ctrl_ptr + 3); //get contents of status register

    while ((status & (int)0x01) != 0) { //wait until video out has finished rendering
        status = *(pixel_ctrl_ptr + 3);
        PS2_data = *(PS2_ptr); // read the Data register in the PS/2 port
        RVALID = PS2_data & 0x8000; // extract the RVALID field
        if (RVALID) {
            byte1 = byte2;
            byte2 = byte3;
            byte3 = PS2_data & 0xFF;
            if ((byte1 != break_key) && (byte2 != break_key) && (byte3 != break_key)) {
                *keyboard_data_ptr = byte3;
            } else
                *keyboard_data_ptr = break_key;
        }
    } */

    //stall for a little while because otherwise the cursor moves too fast
    for (int i = 0; i < CURSOR_DELAY; i++) {
        PS2_data = *(PS2_ptr); // read the Data register in the PS/2 port
        RVALID = PS2_data & 0x8000; // extract the RVALID field
        if (RVALID) {
            //shify key code bytes to make room for new byte
            byte1 = byte2;
            byte2 = byte3;
            byte3 = PS2_data & 0xFF;
            if ((byte1 != break_key) && (byte2 != break_key) && (byte3 != break_key)) {
                *keyboard_data_ptr = byte3;
            }
            else
                *keyboard_data_ptr = break_key;
        }
    }
}

//draw example image on left side and incomplete image on right side of screen
//fill example and trace arrays with the pixel colours currently on the screen
void draw_dino(short int example[HEIGHT][WIDTH], short int trace[HEIGHT][WIDTH]) {
    //draw dino image from array
    int i = 0, j = 0;
    //for template
    for (int k = 0; k < 160 * 2 * 240 - 1; k += 2) {

        int red = ((dino[k + 1] & 0xF8) >> 3) << 11;
        int green = (((dino[k] & 0xE0) >> 5)) | ((dino[k + 1] & 0x7) << 3);

        int blue = (dino[k] & 0x1f);

        short int p = red | ((green << 5) | blue);

        plot_pixel(0 + i, j, p);
        example[i][j] = p;

        i += 1;
        if (i == 160) {
            i = 0;
            j += 1;
        }
    }
    //for trace
    i = 160;
    j = 0;
    for (int k = 0; k < 160 * 2 * 240 - 1; k += 2) {


        int red = ((dino_trace[k + 1] & 0xF8) >> 3) << 11;
        int green = (((dino_trace[k] & 0xE0) >> 5)) | ((dino_trace[k + 1] & 0x7) << 3);

        int blue = (dino_trace[k] & 0x1f);

        short int p = red | ((green << 5) | blue);

        plot_pixel(0 + i, j, p);
        trace[i - 160][j] = p;

        i += 1;
        if (i == 320) {
            i = 160;
            j += 1;
        }
    }
}

