void disp_hex_msg(bool wonGame, volatile int * key_data_reg, int * key_data) {
    int timer_ld_val = 50000000;
    *(priv_timer_ld) = timer_ld_val;
    *(priv_timer_ld + 2) = 1;
    unsigned char congrats[14] = {0x39, 0x5C, 0x54, 0x3D, 0x50, 0x77, 0x78, 0x6D, 0x0, 0x0, 0x0, 0x0, 0x0, 0x0}; //congrats------
    unsigned char gameover[20] = {0x6D, 0x5C, 0x50, 0x50, 0x6E, 0x0, 0x6E, 0x5C, 0x3E, 0x0, 0x38, 0x5C, 0x6D, 0x79, 0x0, 0x0, 0x0, 0x0, 0x0, 0x0}; //sorry-you-lose------
    int i = 0;
    unsigned int HEX0 = 0, HEX1 = 0, HEX2 = 0, HEX3 = 0, HEX4 = 0, HEX5 = 0;

    while (true) {
        if (*(priv_timer_ld + 1) == 0) {
            //shift letters to next HEX display
            HEX5 = HEX4;
            HEX4 = HEX3;
            HEX3 = HEX2;
            HEX2 = HEX1;
            HEX1 = HEX0;
            HEX0 = wonGame ? congrats[i] : gameover[i];
            //assemble bitcodes into the right positions and write to hex display
            *(HEX3_HEX0_ptr) = ((HEX3 << 24) | (HEX2 << 16)) | ((HEX1 << 8) | HEX0);
            *(HEX5_HEX4_ptr) = ((HEX5 << 8) | HEX4);
            //reset timer load value, enable timer, reset flag
            *(priv_timer_ld) = timer_ld_val;
            *(priv_timer_ld + 2) = 1;
            *(priv_timer_ld + 3) = 1;
            i++;
        }

        if ((wonGame && (i >= 14)) || (!wonGame && (i >= 20))) {
            i = 0;
        }
        //if user pressed a key, restart the game
        *key_data = *key_data_reg & 0xF;
        switch (*key_data) {
            case KEY0: {
                *key_data = 0;
                return;
            }
            case KEY1: {
                *key_data = 1;
                return;
            }
            case KEY2: {
                *key_data = 2;
                return;
            }
            case KEY3: {
                *key_data = 3;
                return;
            }
        }

        int PS2_data_dummy = *(PS2_ptr); // read the Data register in the PS/2 port
    }
}

//poll keys. return the number corresponding to the key that was pressed
int wait_to_start_game(volatile int* key_data_reg) {
    do {
        int key_data = *key_data_reg & 0xF;
        switch (key_data) {
        case KEY0:
            return 0;
        case KEY1:
            return 1;
        case KEY2:
            return 2;
        case KEY3:
            return 3;
        default:;
        }

        int PS2_data_dummy = *(PS2_ptr); // read the Data register in the PS/2 port
    } while (true);
}